VALUES
	('The Climate Interactive Simulation is a lightweight GHG model, written in the Vensim simulation language, and developed by researchers from the Sustainability Institute and Rocky Mountain Institute. Although it is lightweight enough to be run on a personal computer, its results are consistent with much larger models, including the MiniCam and Merge models.  The web-based version of the model is hosted at the <a href=\'http://forio.com/simulation/international-climate-change-simulation/\'>Forio</a> website.','240','Climate Interactive Simulation','http://localhost:8080/pangaea-servlet/rest/','PUBLIC','2009-08-30 15:02:33',NULL),
