	('5a31a228-4270-4ccf-80e7-93a10c770854',20603,14880,14844,10112,10144,'Test Test','2009-11-05 13:28:01','2009-11-05 13:29:26',14862,'About',1.1,0,'The Climate Collaboratorium is designed to allow large groups of people to collaborate in developing plans to address climate change.\n\nThis [introductory video|http://techtv.mit.edu/videos/4253-climate-collaboratorium-vision] describes the vision behind the Collaboratorium and the project\'s overall objectives.\n\nIn the Collaboratorium, people can work together to develop, assess, and select [Plans].\n\nThey can also participate in [Debates] about key climate change issues.\n\nAnd this how-to video (link to be added later) shows how you can view and comment on plans (link to be added later), vote for plans (link to be added later), create new plans (link to be added later), and contribute to debates (link to be added later).\n\nFor a list of all the ways you could get involved, go to [How can you help?|How can you help?]\n\nFor more detailed descriptions of various aspects of the Collaboratorium, go to the links below.\n\n- [What the Collaboratorium is]\n\n- [How the Collaboratorium works]\n\n- [Collaboratorium community]\n\n- [Collaboratorium software platform]\n\n- [Current task--Copenhagen challenge|Current task--Copenhagen challenge]\n\n- [Future tasks]\n\n\\\\\nReturn to the [Climate Collaboratorium|http://cognosis.mit.edu:8082/climate-collab]','','creole',0,'',''),
	('26906abc-aea3-40f9-94c8-9e3e501e5cbe',20604,14880,14844,10112,10144,'Test Test','2009-11-05 13:29:26','2009-11-05 13:29:26',14862,'About',1.2,0,'The Climate Collaboratorium is designed to allow large groups of people to collaborate in developing plans to address climate change.\n\nThis [introductory video|http://techtv.mit.edu/videos/4253-climate-collaboratorium-vision] describes the vision behind the Collaboratorium and the project\'s overall objectives.\n\nIn the Collaboratorium, people can work together to develop, assess, and select [Plans].\n\nThey can also participate in [Debates] about key climate change issues.\n\nAnd this how-to video (link to be added later) shows how you can view and comment on plans (link to be added later), vote for plans (link to be added later), create new plans (link to be added later), and contribute to debates (link to be added later).\n\nFor a list of all the ways you could get involved, go to [How can you help?|How can you help?]\n\nFor more detailed descriptions of various aspects of the Collaboratorium, go to the links below.\n\n* [What the Collaboratorium is]\n\n* [How the Collaboratorium works]\n\n* [Collaboratorium community]\n\n* [Collaboratorium software platform]\n\n* [Current task--Copenhagen challenge|Current task--Copenhagen challenge]\n\n* [Future tasks]\n\n\\\\\nReturn to the [Climate Collaboratorium|http://cognosis.mit.edu:8082/climate-collab]','','creole',1,'','');
